import { useHistory } from 'react-router-dom/cjs/react-router-dom.min';
import "../Common/Styles.css"
import { useEffect, useState } from 'react';
import axios from '../DataAccess/AxiosTemp';
import { useSelector, useDispatch } from 'react-redux';
import { setUser } from '../Redux/UserActions';
function Login() {


    const dispatch = useDispatch();

    const history = useHistory();

    // Function to set a cookie
    const setCookie = (name, value, days) => {
        const expires = new Date();
        expires.setTime(expires.getTime() + days * 24 * 60 * 60 * 1000);
        const cookie = `${name}=${value};expires=${expires.toUTCString()};path=/`;
        document.cookie = cookie;
    };

    // Function to update the loggedUser state and set the corresponding cookie



    // Initialize the user data from the 'loggedUser' cookie when the component mounts
    useEffect(() => {
        const cookies = document.cookie.split('; ');
        for (const cookie of cookies) {
            const [name, value] = cookie.split('=');
            if (name === 'loggedUser') {
                const user = JSON.parse(decodeURIComponent(value));
                setloggedUser(user);
                break;
            }
        }
    }, []);




    const LoggedIn = () => {


        if (loginDtl.email != undefined && loginDtl.password != undefined) {
            //console.log(loggedUser)
            Login();
        }
        else {

        }
        if (loggedUser.token != undefined) {

            // console.log(loggedUser.userType);
            // sessionStorage.setItem("loggedUserDatatoken",loggedUser.token);
            // sessionStorage.setItem("loggedUserDatatype",loggedUser.type);
            // sessionStorage.setItem("loggedUserDataid",loggedUser.id);
            // sessionStorage.setItem("loggedUserDatafirstname",loggedUser.firstName);
            // sessionStorage.setItem("loggedUserDatalastname",loggedUser.lastName);
            // sessionStorage.setItem("loggedUserDataemail",loggedUser.email);
            //sessionStorage.setItem("loggedUserDatausertype", loggedUser.userType);
            // dispatch(setUser(loggedUser));



            const updateLoggedUser = (newUser) => {
                setloggedUser(newUser);
                setCookie('loggedUser', JSON.stringify(newUser), 7); // Set a cookie named 'loggedUser' with the user data that expires in 7 days
            };



            history.push('/LogTheUser');
        }
        else {
            console.log("nvalid Id or pass")
        }
    }


    const SignUpVoter = () => {
        history.push("/SignUpVoter")
    }

    const [loggedUser, setloggedUser] = useState({
        token: "",
        type: "",
        id: "",
        firstName: "",
        lastName: "",
        email: "",
        userType: ""
    })

    const [loginDtl, setloginDtl] = useState({
        email: "",
        password: ""
    });

    const loginDtlchange = (args) => {
        var copyofloginDtl = { ...loginDtl };

        copyofloginDtl[args.target.name] = args.target.value;
        setloginDtl(copyofloginDtl);
    }


    const Login = async () => {
        try {

            const result = await axios.post('/authorize/signin', loginDtl, {
                headers: {
                    'Content-Type': 'application/json',
                    'Accept': 'application/json'
                },
            })
            setloggedUser(result.data);
            //console.log(result.data)

        }
        catch (error) {
            console.log("Error Occured" + error);
        }
    }


    return <>




        <header className="header">

            <div className="header-buttons">
                <h4>Want To Sign Up As Voter ..</h4>
                <button className="header-button" onClick={SignUpVoter}>Sign Up</button>
            </div>

        </header>


        <div>
            <div class="jumbotron" style={{ backgroundColor: 'white' }} >

            </div>
        </div>

        <div class="container ">

            <div class="form-group">
                <label class="control-label col-sm-2"></label>
                <div class="col-sm-10">
                    <center><b>Email</b></center>
                    <br></br>
                    <input type="email" class="custom-select" placeholder="Enter Email" name="email" value={loginDtl.email} onChange={loginDtlchange} ></input>

                </div>
                <br></br><br></br>
            </div>
            <div class="form-group">
                <label class="control-label col-sm-2" for="pwd"></label>
                <div class="col-sm-10">
                    <br></br>
                    <center><b>Password</b></center>
                    <br></br>
                    <input type="password" class="custom-select" placeholder="Enter password" name="password" value={loginDtl.password} onChange={loginDtlchange}></input>
                </div>
            </div>
            <br></br><br></br><br></br>

            <div class="form-group">
                <div class="col-sm-offset-2 col-sm-10">
                    <br></br>
                    <button className="header-button" onClick={LoggedIn} class="btn btn-success">Login</button>
                </div>
                <div class="col-sm-12">
                    <center><p><a href="#">Forget Password? Click Here</a></p></center>
                </div>
            </div>

        </div>

    </>
}

export default Login;
